class Solution:
    def minimumOperations(self, num: str) -> int:
        # Function to check minimum deletions to form a number ending with given pair
        def minDeletionsToEndWith(pair):
            lastIndex = -1
            deletions = 0
            # Search for each digit in the pair from the end
            for digit in reversed(pair):
                found = False
                for i in range(lastIndex - 1, -1, -1):
                    if num[i] == digit:
                        deletions += lastIndex - i - 1
                        lastIndex = i
                        found = True
                        break
                if not found:
                    return float('inf')
            return deletions + lastIndex  # Add remaining digits to the left

        # Special cases if num ends with '00', '25', '50', '75'
        res = min(
            minDeletionsToEndWith('00'),
            minDeletionsToEndWith('25'),
            minDeletionsToEndWith('50'),
            minDeletionsToEndWith('75'),
        )

        return len(num) - 2 if res == float('inf') else res  # If impossible, delete all but one digit
